import React from 'react';
import styled from 'styled-components';
import { CompassOutlined } from '@ant-design/icons';
const EditFormWrapper = styled.div``;
const Form = styled.form``;
const InputWrapper = styled.div`
	margin: 5px 0;
	display: flex;
`;
const InputLabel = styled.label`
	display: none;
`;
const InputUserNote = styled.textarea`
	width: 100%;
	border-radius: 5px;
`;
const Input = styled.input`
	margin-left: 5px;
	border-radius: 5px;
	/* display: block; */
	width: 100%;
	font-size: 10px;
`;
const DetailEditForm = () => {
	return (
		<EditFormWrapper>
			<Form>
				<InputWrapper>
					<InputLabel>직업</InputLabel>
					<InputUserNote type="textarea" placeholder=""></InputUserNote>
				</InputWrapper>
				<InputWrapper>
					<InputLabel>직업</InputLabel>
					<Input placeholder="직업"></Input>
				</InputWrapper>
				<InputWrapper>
					<InputLabel>지역</InputLabel>
					<CompassOutlined />
					<Input placeholder="지역"></Input>
				</InputWrapper>
				<InputWrapper>
					<InputLabel>페이스북 주소</InputLabel>
					<Input placeholder="페이스북 주소"></Input>
				</InputWrapper>
				<InputWrapper>
					<InputLabel>인스타그램 주소</InputLabel>
					<Input placeholder="인스타그램 주소"></Input>
				</InputWrapper>
			</Form>
		</EditFormWrapper>
	);
};

export default DetailEditForm;
